import React from "react";
import Homepage from "./pages/homepage/homepage.component";
import { Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/home/:id" component={Homepage} />
      </Switch>
    </div>
  );
}

export default App;
